// ==UserScript==
// @name         Cheetah AI Chat Widget
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  Floating Cheetah AI chat widget with cool effects
// @author       KaitoNeko
// @icon         data:image/png;base64,
// @match        *://*/*
// @license      MPL-2.0
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/546029/Cheetah%20AI%20Chat%20Widget.user.js
// @updateURL https://update.greasyfork.org/scripts/546029/Cheetah%20AI%20Chat%20Widget.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Crear el icono flotante
    const floatingIcon = document.createElement('div');
    floatingIcon.id = 'cheetah-floating-icon';
    floatingIcon.innerHTML = `
        <img src="data:image/png;base64," alt="Cheetah AI" style="width: 100%; height: 100%;">
    `;

    // Estilos para el icono flotante (solo imagen)
    floatingIcon.style.cssText = `
        position: fixed;
        top: 20px;
        right: 20px;
        width: 60px;
        height: 60px;
        cursor: pointer;
        z-index: 10000;
        transition: all 0.4s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        filter: drop-shadow(0 8px 16px rgba(255, 181, 67, 0.3));
        animation: floating 3s ease-in-out infinite;
    `;

    // CSS para animaciones
    const style = document.createElement('style');
    style.textContent = `
        @keyframes floating {
            0%, 100% { transform: translateY(0px) rotate(0deg); }
            50% { transform: translateY(-10px) rotate(2deg); }
        }

        @keyframes pulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        @keyframes typing {
            0%, 100% { opacity: 0.3; }
            50% { opacity: 1; }
        }

        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translate(-50%, -50%) scale(0.8) rotateY(90deg);
            }
            to {
                opacity: 1;
                transform: translate(-50%, -50%) scale(1) rotateY(0deg);
            }
        }

        @keyframes messageSlide {
            from {
                opacity: 0;
                transform: translateX(-20px);
            }
            to {
                opacity: 1;
                transform: translateX(0);
            }
        }

        @keyframes userMessageSlide {
            from {
                opacity: 0;
                transform: translateX(20px);
            }
            to {
                opacity: 1;
                transform: translateX(0);
            }
        }

        .chat-window-show {
            animation: slideIn 0.5s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        .ai-message {
            animation: messageSlide 0.4s ease-out;
        }

        .user-message {
            animation: userMessageSlide 0.4s ease-out;
        }

        .typing-indicator {
            display: flex;
            align-items: center;
            gap: 4px;
            padding: 16px;
            background: #F3F4F6;
            border-radius: 12px;
            margin-bottom: 16px;
            max-width: 85%;
        }

        .typing-dot {
            width: 8px;
            height: 8px;
            background: #FFB543;
            border-radius: 50%;
            animation: typing 1.4s infinite ease-in-out;
        }

        .typing-dot:nth-child(2) { animation-delay: 0.2s; }
        .typing-dot:nth-child(3) { animation-delay: 0.4s; }

        .glow-effect {
            box-shadow: 0 0 30px rgba(255, 181, 67, 0.5) !important;
            animation: pulse 2s infinite !important;
        }

        .chat-input-focus {
            background: linear-gradient(45deg, #FFB543, #FF8C00) !important;
            background-size: 200% 200% !important;
            animation: gradientShift 3s ease infinite !important;
        }

        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }

        .button-hover {
            transform: translateY(-2px) scale(1.05) !important;
            box-shadow: 0 8px 25px rgba(255, 181, 67, 0.4) !important;
        }

        .particle {
            position: absolute;
            width: 4px;
            height: 4px;
            background: #FFB543;
            border-radius: 50%;
            pointer-events: none;
            animation: particle-float 2s linear infinite;
        }

        @keyframes particle-float {
            0% {
                opacity: 1;
                transform: translateY(0) scale(1);
            }
            100% {
                opacity: 0;
                transform: translateY(-100px) scale(0);
            }
        }
    `;
    document.head.appendChild(style);

    // Crear la ventana de chat
    const chatWindow = document.createElement('div');
    chatWindow.id = 'cheetah-chat-window';
    chatWindow.style.cssText = `
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: 600px;
        height: 700px;
        background: linear-gradient(135deg, #1a1a1a 0%, #2d2d2d 100%);
        border-radius: 20px;
        box-shadow: 0 25px 80px rgba(0, 0, 0, 0.3);
        z-index: 10001;
        display: none;
        font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
        overflow: hidden;
        border: 2px solid #FFB543;
        backdrop-filter: blur(10px);
    `;

    chatWindow.innerHTML = `
        <div style="
            background: linear-gradient(135deg, #FFB543 0%, #FF8C00 100%);
            padding: 20px;
            color: #1a1a1a;
            display: flex;
            justify-content: space-between;
            align-items: center;
            font-weight: 700;
            font-size: 18px;
            position: relative;
            overflow: hidden;
        ">
            <div style="display: flex; align-items: center; gap: 12px; z-index: 2;">
                <div style="
                    width: 12px;
                    height: 12px;
                    background: #10B981;
                    border-radius: 50%;
                    animation: pulse 2s infinite;
                "></div>
                <span> Cheetah AI</span>
            </div>
            <button id="close-chat" style="
                background: rgba(26, 26, 26, 0.2);
                border: none;
                color: #1a1a1a;
                font-size: 24px;
                cursor: pointer;
                padding: 8px;
                border-radius: 50%;
                transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
                width: 40px;
                height: 40px;
                display: flex;
                align-items: center;
                justify-content: center;
                z-index: 2;
            "></button>
            <div style="
                position: absolute;
                top: 0;
                left: -100%;
                width: 100%;
                height: 100%;
                background: linear-gradient(45deg, transparent, rgba(255,255,255,0.2), transparent);
                animation: shine 3s infinite;
            "></div>
        </div>

        <div id="chat-messages" style="
            flex: 1;
            padding: 24px;
            overflow-y: auto;
            max-height: 550px;
            background: linear-gradient(180deg, #1a1a1a 0%, #2d2d2d 100%);
            position: relative;
        ">
            <div class="ai-message" style="
                background: linear-gradient(135deg, #2d2d2d 0%, #3d3d3d 100%);
                padding: 20px;
                border-radius: 16px;
                margin-bottom: 16px;
                color: #ffffff;
                font-size: 15px;
                border: 1px solid #FFB543;
                box-shadow: 0 4px 15px rgba(255, 181, 67, 0.1);
                position: relative;
                overflow: hidden;
            ">
                <div style="
                    position: absolute;
                    top: 0;
                    left: 0;
                    width: 4px;
                    height: 100%;
                    background: linear-gradient(180deg, #FFB543, #FF8C00);
                "></div>
                <div style="margin-left: 12px;">
                    Hola!  Soy Cheetah AI, tu asistente sper rpido. En qu puedo ayudarte hoy?
                </div>
            </div>
        </div>

        <div style="
            padding: 24px;
            background: linear-gradient(135deg, #2d2d2d 0%, #1a1a1a 100%);
            border-top: 1px solid #FFB543;
        ">
            <div style="display: flex; gap: 16px; align-items: end;">
                <div style="flex: 1; position: relative;">
                    <input
                        type="text"
                        id="chat-input"
                        placeholder="Escribe tu mensaje sper rpido..."
                        style="
                            width: 100%;
                            padding: 16px 20px;
                            border: 2px solid #3d3d3d;
                            border-radius: 12px;
                            font-size: 15px;
                            outline: none;
                            transition: all 0.3s ease;
                            background: #1a1a1a;
                            color: #ffffff;
                            box-sizing: border-box;
                        "
                    />
                </div>
                <button id="send-message" style="
                    background: linear-gradient(135deg, #FFB543 0%, #FF8C00 100%);
                    color: #1a1a1a;
                    border: none;
                    padding: 16px 24px;
                    border-radius: 12px;
                    cursor: pointer;
                    font-weight: 600;
                    transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
                    min-width: 80px;
                    font-size: 15px;
                    position: relative;
                    overflow: hidden;
                ">
                     Enviar
                </button>
            </div>
        </div>
    `;

    // Crear overlay con efectos
    const overlay = document.createElement('div');
    overlay.id = 'cheetah-overlay';
    overlay.style.cssText = `
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: radial-gradient(circle, rgba(255,181,67,0.1) 0%, rgba(0,0,0,0.8) 100%);
        z-index: 10000;
        display: none;
        backdrop-filter: blur(5px);
    `;

    // Agregar ms CSS para efectos
    style.textContent += `
        @keyframes shine {
            0% { left: -100%; }
            100% { left: 100%; }
        }

        .message-glow {
            box-shadow: 0 0 20px rgba(255, 181, 67, 0.3);
        }
    `;

    // Agregar elementos al DOM
    document.body.appendChild(floatingIcon);
    document.body.appendChild(overlay);
    document.body.appendChild(chatWindow);

    // Variables para arrastrar
    let isDragging = false;
    let dragOffset = { x: 0, y: 0 };

    // Eventos para arrastrar el icono
    floatingIcon.addEventListener('mousedown', (e) => {
        isDragging = true;
        dragOffset.x = e.clientX - floatingIcon.offsetLeft;
        dragOffset.y = e.clientY - floatingIcon.offsetTop;
        floatingIcon.style.cursor = 'grabbing';
        createParticles(e.clientX, e.clientY);
    });

    document.addEventListener('mousemove', (e) => {
        if (isDragging) {
            floatingIcon.style.left = (e.clientX - dragOffset.x) + 'px';
            floatingIcon.style.top = (e.clientY - dragOffset.y) + 'px';
            floatingIcon.style.right = 'auto';
        }
    });

    document.addEventListener('mouseup', () => {
        if (isDragging) {
            isDragging = false;
            floatingIcon.style.cursor = 'pointer';
        }
    });

    // Funcin para crear partculas
    function createParticles(x, y) {
        for (let i = 0; i < 6; i++) {
            const particle = document.createElement('div');
            particle.className = 'particle';
            particle.style.left = x + 'px';
            particle.style.top = y + 'px';
            particle.style.animationDelay = (i * 0.1) + 's';
            document.body.appendChild(particle);

            setTimeout(() => {
                particle.remove();
            }, 2000);
        }
    }

    // Funcin para abrir/cerrar chat
    function toggleChat() {
        const isVisible = chatWindow.style.display === 'block';

        if (isVisible) {
            chatWindow.style.animation = 'slideIn 0.3s reverse';
            setTimeout(() => {
                chatWindow.style.display = 'none';
                overlay.style.display = 'none';
            }, 300);
        } else {
            chatWindow.style.display = 'block';
            overlay.style.display = 'block';
            chatWindow.classList.add('chat-window-show');
            document.getElementById('chat-input').focus();
        }
    }

    // Funcin para mostrar indicador de escritura
    function showTypingIndicator() {
        const messagesContainer = document.getElementById('chat-messages');
        const typingDiv = document.createElement('div');
        typingDiv.id = 'typing-indicator';
        typingDiv.className = 'typing-indicator';

        typingDiv.innerHTML = `
            <span style="color: #FFB543; margin-right: 8px;"> Cheetah AI est escribiendo</span>
            <div class="typing-dot"></div>
            <div class="typing-dot"></div>
            <div class="typing-dot"></div>
        `;

        messagesContainer.appendChild(typingDiv);
        messagesContainer.scrollTop = messagesContainer.scrollHeight;
    }

    // Funcin para ocultar indicador de escritura
    function hideTypingIndicator() {
        const typingDiv = document.getElementById('typing-indicator');
        if (typingDiv) {
            typingDiv.remove();
        }
    }

    // Funcin para agregar mensaje al chat
    function addMessage(content, isUser = false) {
        const messagesContainer = document.getElementById('chat-messages');
        const messageDiv = document.createElement('div');

        messageDiv.className = isUser ? 'user-message' : 'ai-message';
        messageDiv.style.cssText = `
            margin-bottom: 16px;
            padding: 20px;
            border-radius: 16px;
            max-width: 85%;
            word-wrap: break-word;
            line-height: 1.6;
            font-size: 15px;
            position: relative;
            overflow: hidden;
            ${isUser ?
                `
                background: linear-gradient(135deg, #FFB543 0%, #FF8C00 100%);
                color: #1a1a1a;
                margin-left: auto;
                text-align: right;
                font-weight: 500;
                box-shadow: 0 4px 15px rgba(255, 181, 67, 0.3);
                ` :
                `
                background: linear-gradient(135deg, #2d2d2d 0%, #3d3d3d 100%);
                color: #ffffff;
                margin-right: auto;
                border: 1px solid #FFB543;
                box-shadow: 0 4px 15px rgba(255, 181, 67, 0.1);
                `
            }
        `;

        if (!isUser) {
            messageDiv.innerHTML = `
                <div style="
                    position: absolute;
                    top: 0;
                    left: 0;
                    width: 4px;
                    height: 100%;
                    background: linear-gradient(180deg, #FFB543, #FF8C00);
                "></div>
                <div style="margin-left: 12px;">${content}</div>
            `;
        } else {
            messageDiv.textContent = content;
        }

        messagesContainer.appendChild(messageDiv);
        messagesContainer.scrollTop = messagesContainer.scrollHeight;

        // Efecto glow temporal
        setTimeout(() => {
            messageDiv.classList.add('message-glow');
            setTimeout(() => {
                messageDiv.classList.remove('message-glow');
            }, 1000);
        }, 100);
    }

    // Funcin para enviar mensaje a la API
    async function sendMessageToAPI(message) {
        showTypingIndicator();

        try {
            const response = await fetch('https://ai-api.drexelxx.workers.dev/api/chat', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    message: message,
                    model: 'cheetah-ai',
                    temperature: 0.8
                })
            });

            hideTypingIndicator();

            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }

            const data = await response.json();
            const aiResponse = data.response || data.message || data.content || 'Ups!  Algo sali mal, pero soy sper rpido, intntalo de nuevo!';

            // Simular delay para mostrar la animacin de escritura
            setTimeout(() => {
                addMessage(aiResponse, false);
            }, 500);

        } catch (error) {
            hideTypingIndicator();
            console.error('Error calling API:', error);
            addMessage(' Velocidad reducida! No pude conectar con mis sper poderes. Intntalo de nuevo, tigre! ', false);
        }
    }

    // Funcin para enviar mensaje
    function sendMessage() {
        const input = document.getElementById('chat-input');
        const message = input.value.trim();

        if (message) {
            addMessage(message, true);
            input.value = '';
            sendMessageToAPI(message);
            createParticles(input.getBoundingClientRect().left, input.getBoundingClientRect().top);
        }
    }

    // Event listeners
    floatingIcon.addEventListener('click', (e) => {
        if (!isDragging) {
            toggleChat();
            createParticles(e.clientX, e.clientY);
        }
    });

    document.getElementById('close-chat').addEventListener('click', toggleChat);
    overlay.addEventListener('click', toggleChat);
    document.getElementById('send-message').addEventListener('click', sendMessage);

    document.getElementById('chat-input').addEventListener('keypress', (e) => {
        if (e.key === 'Enter') {
            sendMessage();
        }
    });

    // Efectos sper chveres para el icono
    floatingIcon.addEventListener('mouseenter', () => {
        if (!isDragging) {
            floatingIcon.classList.add('glow-effect');
            floatingIcon.style.transform = 'scale(1.2) rotate(5deg)';
        }
    });

    floatingIcon.addEventListener('mouseleave', () => {
        if (!isDragging) {
            floatingIcon.classList.remove('glow-effect');
            floatingIcon.style.transform = 'scale(1) rotate(0deg)';
        }
    });

    // Efectos para botones
    document.getElementById('send-message').addEventListener('mouseenter', (e) => {
        e.target.classList.add('button-hover');
    });

    document.getElementById('send-message').addEventListener('mouseleave', (e) => {
        e.target.classList.remove('button-hover');
    });

    document.getElementById('close-chat').addEventListener('mouseenter', (e) => {
        e.target.style.background = 'rgba(255, 181, 67, 0.3)';
        e.target.style.transform = 'scale(1.1) rotate(90deg)';
    });

    document.getElementById('close-chat').addEventListener('mouseleave', (e) => {
        e.target.style.background = 'rgba(26, 26, 26, 0.2)';
        e.target.style.transform = 'scale(1) rotate(0deg)';
    });

    // Efectos sper geniales para el input
    document.getElementById('chat-input').addEventListener('focus', (e) => {
        e.target.style.borderColor = '#FFB543';
        e.target.style.boxShadow = '0 0 20px rgba(255, 181, 67, 0.4)';
        e.target.style.background = 'linear-gradient(135deg, #1a1a1a 0%, #2d2d2d 100%)';
    });

    document.getElementById('chat-input').addEventListener('blur', (e) => {
        e.target.style.borderColor = '#3d3d3d';
        e.target.style.boxShadow = 'none';
        e.target.style.background = '#1a1a1a';
    });

    // Efectos de partculas al escribir
    document.getElementById('chat-input').addEventListener('input', (e) => {
        if (Math.random() > 0.7) {
            const rect = e.target.getBoundingClientRect();
            createParticles(rect.right - 20, rect.top + rect.height/2);
        }
    });

})();